    [TestClass]
    public class TestWordToShift
    {
        
        [TestMethod]
        public void TestWordToShiftWorks()
        {
            char[] test1 = "Flern ".ToCharArray();
            char[] test2 = "Boingo Bongo ".ToCharArray();
            char[] test3 = "Hermies".ToCharArray();
            char[] test4 = "Have a nice day".ToCharArray();
            Assert.IsTrue(Program.SwapEndToFrontAndShiftRight(test1) == " Flern");
            Assert.IsTrue(Program.SwapEndToFrontAndShiftRight(test2) == " Boingo Bongo");
            Assert.IsTrue(Program.SwapEndToFrontAndShiftRight(test3) == "sHermie");

            string result = "";
            int middleSpace = 0;
            for(int i = 0; i<= test4.Length; i++)
            {
                if (test4[i] == ' ' && i >= (test4.Length / 2) - 1) break;
                middleSpace += 1;
            }
            for (int i = 0; i<= middleSpace; i++)
            {
                result = Program.SwapEndToFrontAndShiftRight(test4);
                test4 = result.ToCharArray();
            }

            Assert.IsTrue(result == "day nice a Have");
        }

        [TestMethod]
        public void TestAddList()
        {
            ListNode ln = new ListNode(5);
            ln.next = new ListNode(4);
            ln.next.next = new ListNode(3);

            ListNode ln2 = new ListNode(2);
            ln2.next = new ListNode(8);
            ln2.next.next = new ListNode(1);

            var result = ListNodeProblems.GetLinkedListAfterAddition(ln, ln2);
        }
    }

    [TestClass]
    public class TestPermutation
    {
        [TestMethod]
        public void TestSwap()
        {
            char[] myChars = new char[] { 'b', 'u', 'd' };
            Permutation.Swap(ref myChars[0], ref myChars[2]);
            string result = new string(myChars);
            Assert.IsTrue(result == "dub");
        }

        [TestMethod]
        public void TestPermutations()
        {
            var p = new Permutation();
            var results = p.GetPermutations("abc");
            Assert.IsTrue(results.Count > 5);
        }
    }

