    [TestClass]
    public class TestAbsoluteFilepath
    {
        [TestMethod]
        public void TestLengthLongestPath()
        {
            int answer = LongestAbsoluteFilepath.LengthLongestPath("dir\n\tsubdir1\n\tsubdir2\n\t\tfile.ext");
            Assert.IsTrue(answer == 20);

            int answer2 = LongestAbsoluteFilepath.LengthLongestPath("dir\n\tsubdir1\n\t\tfile1.ext\n\t\tsubsubdir1\n\tsubdir2\n\t\tsubsubdir2\n\t\t\tfile2.ext");
            Assert.IsTrue(answer2 == 32);

            int answer3 = LongestAbsoluteFilepath.LengthLongestPath("a");
            Assert.IsTrue(answer3 == 0);

            int answer4 = LongestAbsoluteFilepath.LengthLongestPath("dir\n\tsubdir1\n\tsubdir2\n\t\tfile.ext");
            Assert.IsTrue(answer4 == 20);

            int answer5 = LongestAbsoluteFilepath.LengthLongestPath("dir\n    file.txt");
            Assert.IsTrue(answer5 == 12);

            int answer6 = LongestAbsoluteFilepath.LengthLongestPath("dir\n        file.txt");
            Assert.IsTrue(answer6 == 16);

            int answer7 = LongestAbsoluteFilepath.LengthLongestPath("a\n\tb1\n\t\tf1.txt\n\taaaaa\n\t\tf2.txt");
            Assert.IsTrue(answer7 == 14);

            int answer8 = LongestAbsoluteFilepath.LengthLongestPath("a\n\taa\n\t\taaa\n\t\t\tfile1.txt\naaaaaaaaaaaaaaaaaaaaa\n\tsth.png");
            Assert.IsTrue(answer8 == 29);
        }
    }

    [TestClass]
    public class TestLfuCache
    {
        [TestMethod]
        public void TestLfuCacheFcn()
        {
            //["LFUCache","put","put","get","put","get","get","put","get","get","get"]
            // [[2],      [1,1], [2,2],[1],  [3,3],[2],  [3],  [4,4],[1],  [3], [4]]

            //[null,null,null,1,null,-1,3,null,-1,3,4]
            var lfuCache = new LFUCache(2);
            lfuCache.Put(1, 1);
            lfuCache.Put(2, 2);
            lfuCache.Get(1);
            lfuCache.Put(3, 3);
            lfuCache.Get(2);
            lfuCache.Get(3);
            lfuCache.Put(4, 4);
            lfuCache.Get(1);
            lfuCache.Get(3);
            lfuCache.Get(4);

            //    ["LFUCache","put","put","get","get","get","put","put","get","get","get","get"]
            //      [[3],     [2,2],[1,1],[2],   [1],   [2],[3,3],[4,4], [3],  [2],  [1],  [4]]
            //[null,null,null,2,1,2,null,null,-1,2,1,4]
            var lfuCache2 = new LFUCache(3);
            lfuCache2.Put(2, 2);
            lfuCache2.Put(1, 1);
            Assert.IsTrue(lfuCache2.Get(2) == 2);
            Assert.IsTrue(lfuCache2.Get(1) == 1);
            Assert.IsTrue(lfuCache2.Get(2) == 2);
            lfuCache2.Put(3, 3);
            lfuCache2.Put(4, 4);
            Assert.IsTrue(lfuCache2.Get(3) == -1);
            Assert.IsTrue(lfuCache2.Get(2) == 2);
            Assert.IsTrue(lfuCache2.Get(1) == 1);
            Assert.IsTrue(lfuCache2.Get(4) == 4);

            //    ["LFUCache","put","put","put","put","get","get","get","get","put","get","get","get","get","get"]
            //        [[3],    [1,1],[2,2],[3,3],[4,4],[4],  [3],   [2],  [1],[5,5], [1],  [2],  [3],   [4],[5]]
            //[null,null,null,null,null,4,3,2,-1,null,-1,2,3,-1,5]
            var lfuCache3 = new LFUCache(3);
            lfuCache3.Put(1, 1);
            lfuCache3.Put(2, 2);
            lfuCache3.Put(3, 3);
            lfuCache3.Put(4, 4);
            Assert.IsTrue(lfuCache3.Get(4) == 4);
            Assert.IsTrue(lfuCache3.Get(3) == 3);
            Assert.IsTrue(lfuCache3.Get(2) == 2);
            Assert.IsTrue(lfuCache3.Get(1) == -1);
            lfuCache3.Put(5, 5);
            Assert.IsTrue(lfuCache3.Get(1) == -1);
            Assert.IsTrue(lfuCache3.Get(2) == 2);
            Assert.IsTrue(lfuCache3.Get(3) == 3);
            Assert.IsTrue(lfuCache3.Get(4) == -1);
            Assert.IsTrue(lfuCache3.Get(5) == 5);
        }
    }
}
